import React from 'react';
import './Dashboard.css';

const Dashboard = ({ matchPercentage }) => {
  return (
    <div className="dashboard">
      <h1>Dashboard</h1>
      {matchPercentage !== null ? (
        <p>Your resume matches the job description by {matchPercentage}%</p>
      ) : (
        <p>This is where the analysis results will be displayed.</p>
      )}
    </div>
  );
}

export default Dashboard;
